import classes from './css/app.module.css';

export default function App() {
  return (
    <>
      <div className={classes.header}>
        <div className={classes.container}>
          <div className={classes.head}>
            <div>Dev Blog</div>
          </div>
        </div>
      </div>
      <div>
        <div className={classes.title}>
          <h2>입문용 로드 자전거 추천</h2>
        </div>
      </div>
    </>
  );
}
